import React from 'react';
import './Header-wrapper.scss'

const HeaderTop = () => {
    return (
        <div className="header-top">
            <ul>
                <li><i className="fa fa-heart" aria-hidden="true"></i>
                <a>Sản phẩm yêu thích</a>
                </li>
                <li><i className="fa fa-user" aria-hidden="true"></i>Tài khoản</li>
                <li><a>Đăng nhập</a></li>
                <li><a>Đăng ký</a></li>
                <li><a>Đăng Xuất</a></li>
            </ul>
        </div>
    );
};

export default HeaderTop;
